<?php

define('UPLOAD_DIR', 'uploads/'); 

$image = "";

$img = str_replace('data:image/png;base64,', '', $image);
$img = str_replace(' ', '+', $img);
$data = base64_decode($img);
$file = UPLOAD_DIR . uniqid() . '.png';
$success = file_put_contents($file, $data);
print $success ? 'Success' : 'Unable to save the file.';

?>
